        <p>Ch∆∞a c√≥ d·ªØ li·ªáu log n√†o.</p>
      ) : (
        <table border="1" cellPadding="6" style={{ width: "100%", borderCollapse: "collapse" }}>
          <thead style={{ background: "#f4f4f4" }}>
            <tr>
              <th>STT</th>
              <th>Ng∆∞·ªùi d√πng</th>
              <th>H√†nh ƒë·ªông</th>
              <th>Th·ªùi gian</th>
              <th>IP</th>
            </tr>
          </thead>
          <tbody>
            {logs.map((log, i) => (
              <tr key={log._id || i}>
